import {useState} from 'react'
import CarData from '../data/CarData'

function 카리스트뷰() {
    let [카데이터, 변동카데이터] = useState (CarData)
    return(
        <div>
           {
               카데이터.map(()=>{
                   return (
                       <카정보컴포넌트 carlist={카데이터[0]}/>
                   )
               })
           }

        <카정보컴포넌트 carlist={카데이터[1]}/>
        <카정보컴포넌트 carlist={카데이터[2]}/>

        </div>
    )
}

export default 카리스트뷰


function 카정보컴포넌트(props) {
    return(
        <div>
            <h2>{props.carlist.model}</h2>
            <p>{props.carlist.number}</p>
            <p>{props.carlist.location}</p>
        </div>
    )

}
